    const serialInput = document.getElementById("serialInput");
    const checkButton = document.getElementById("checkButton");
    const result = document.getElementById("result");

async function hashText(text) {
    const encoder = new TextEncoder();
    const data = encoder.encode(text);
    const hash = await crypto.subtle.digest("SHA-256", data);
    return Array.from(new Uint8Array(hash))
        .map(byte => byte.toString(16).padStart(2, '0'))
        .join('');
}



    checkButton.addEventListener("click", async function() {
      const input = await hashText(serialInput.value.trim().toUpperCase())
      console.log(input);
      result.style.opacity = '0';

      if (!input) {
        result.textContent = "Please enter a serial number.";
        result.style.color = "#e67e22"; // Orange color
      } else if (serialNumbers.includes(input.toUpperCase())) {
        result.textContent = "Replacement Necessary";
        result.style.color = "#e74c3c"; // Red color
      } else {
        result.textContent = "Item is Fine";
        result.style.color = "#2ecc71"; // Green color
      }

      setTimeout(function() {
        result.style.opacity = '1';
      }, 100);
    });

    serialInput.addEventListener("keypress", function(event) {
      if (event.key === 'Enter') {
        event.preventDefault();
        checkButton.click();
      }
    });
